import { createSlice } from '@reduxjs/toolkit'

const alertSlice = createSlice({
    name: 'alert',
    initialState: {
    },
    reducers: {
        setAlert(state, action) {
            return state = action.payload
        }
    }
})

export const alertReducer = alertSlice.reducer
